    def __init__(self):
        self.ans = 0
        self.count = 0
    def calculate(self, n: int, m: int) -> int:
        if n == 0 and m == 0:
            return 0
        elif m == 0:
            return n
        elif n < 0 or m < 0:
            return -1
        else:
            self.count += 1
            self.ans = self.calculate(n // 2, m)
            if n % 2 == 1:
                self.ans += self.calculate(n // 2, m // 2)
            else:
                self.ans += self.calculate(n // 2, m // 2 + 1)
            self.ans %= 1000000007
            return self.ans

